import React, {Component} from 'react';

class Banner extends Component {
	render() {
		return (
			<img src='https://www.jianshu.com/p/c6a2b7f62ac5?utm_medium=index-banner&utm_source=desktop' alt='bannerImage' />
		)
	}
}

export default Banner;
